import { useState, useEffect} from "react";
import axios from "axios";


const Peternakan = () => {
    const [peternakan, setPeternakans] = useState([])
  
    const fetchDataPeternakan = () => {
      fetch("http://localhost:8000/api/peternakan")
        .then(response => {
          return response.json()
        })
        .then(data => {
          setPeternakans(data)
        })
    }

    useEffect(() => {
        fetchDataPeternakan()
      }, [])

    return (
        <div>
          Test
        </div>
      );
    }
    
    export default Peternakan;
